- input: "TEXT\x1CC00462630\x1C.TEXT\x1C\x1CF3XN\x1CCovington & Burling LLP PAC made
    a $2,000 pre-payment on 2/16/2011 (Transaction ID: SB21B.6504) to off-set in-kind
    contributions of staff time for non-compliance related matters. These funds have
    been retained by Covington & Burling LLP as an off-set to potential staff time
    in excess of $5,000, as reported in our February Monthly report (Transaction ID:
    SB21B.4872). As reported in our 2012 post-general report, Covington & Burling
    LLP PAC's year-to-date federal operating  expenditures totaled $5,732.32. Accordingly,
    the $2,000 prepayment has been used to off-set an excess of $732.32 in federal
    operating expenditures, leaving a prepayment balance of $1,267.68. In this reporting
    period, the remaining prepayment balance of $1,267.68 is used to off-set $694.44
    in additional federal operating expenditures. The balance of the prepayment is
    now $573.24, which Covington & Burling LLP will continue to retain.\n"
